import React from 'react';
import Form from 'react-bootstrap/Form';

const AddNewTodo = () => {

    const fnSubmit=(e)=>{
        e.preventDefault();
    }
  return (

    <div className='container p-5'>
              <form action='' onSubmit={fnSubmit}>
  
            <div class="input-group input-group-sm mb-3">
                <span class="input-group-text" id="inputGroup-sizing-sm">Todo Id</span>
                <input type="number" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-sm" required/>
            </div>
            
            </form>
    </div>
  
  )
}

export default AddNewTodo
